PrescriptionManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PrescriptionManager {
    struct Prescription {
        address patient;
        address doctor;
        string details;
        uint256 timestamp;
    }

    Prescription[] public prescriptions;

    event PrescriptionCreated(
        uint256 id,
        address indexed patient,
        address indexed doctor,
        string details,
        uint256 timestamp
    );

    function createPrescription(address _patient, string memory _details) public {
        prescriptions.push(Prescription({
            patient: _patient,
            doctor: msg.sender,
            details: _details,
            timestamp: block.timestamp
        }));

        emit PrescriptionCreated(
            prescriptions.length - 1,
            _patient,
            msg.sender,
            _details,
            block.timestamp
        );
    }

    function getPrescription(uint256 _id) public view returns (address, address, string memory, uint256) {
        require(_id < prescriptions.length, "Prescription does not exist");
        Prescription memory pres = prescriptions[_id];
        return (pres.patient, pres.doctor, pres.details, pres.timestamp);
    }

    function getAllPrescriptions() public view returns (Prescription[] memory) {
        return prescriptions;
    }
}

